import {useState, useEffect} from 'react';
import styled from 'styled-components';
import Container from '../components/Container';
import {frontEnd} from '../techData.js';

export default function TechStack() {

  const box = {
    width: '100px',
    height: '100px'
  }
  return(
    <Container bg={[3,4]}>
      <h1>Tech Stack:</h1>
      <CardContainer>
        {frontEnd.map((data, index) => (
          <Card>
            <Logo style={box} name={data.name}/>
            {data.name}
          </Card>
        ))}
      </CardContainer>
    </Container>
  )
};
const CardContainer = styled.div`
  display: flex;
`;

const Card = styled.div`
  width: 100px;
  height: 200px;
  background: white;
  color:black;
  margin: 0 1em;
`;

const Logo = styled.div`
  ${({name}) => `background-image: url(./logos/${name}.svg);`}

  background-repeat: no-repeat;
  background-size: 100% 100%;
`;
